import React from 'react';
import styled from 'styled-components';
import banner from '../images/productsbg.jpg';
import provec from '../images/provec.jpg';

const Products = () => {
	return (
		<ProductsWrapper>
			<div className='banner'>
				<img src={banner} alt='' />
			</div>
			<div className='products-title'>
				<h3>Products</h3>
			</div>

			<section className='restpart'>
				<section className='filter'>
					{/* text search */}

					<label htmlFor='search'>Search Products</label>
					<input
						type='text'
						name='search'
						id='search'
						className='form-control'
					/>
				</section>
			</section>
		</ProductsWrapper>
	);
};

export default Products;

const ProductsWrapper = styled.div`
	position: relative;
	top: 70px;
	.banner {
		width: 100%;
		height: 250px;
	}
	.banner img {
		width: 100%;
		height: 100%;
	}
	.products-title {
		font-family: 'Poppins';
		margin: 2rem auto;
		text-align: center;

		width: 150px;
	}
	h3 {
		position: relative;
		font-weight: 800;
	}

	.restpart {
		background: url(${provec});
		background-position: center;
		background-attachment: fixed;
		background-size: cover;
		height: 300px;
		width: 100%;
		color: #fff;
		text-align: center;
	}
	label {
		margin: 4rem 0;
		font-size: 2.5rem;
		font-family: 'Poppins';
		text-shadow: 8px 8px 50px rgba(0, 0, 0, 0.9);
	}
`;
